function SidebarComponent (props) {
    let sideList = props.articles.map(a => a.name);
    console.log(sideList);

    function listElement () {
        let listCount = 0;
        return(
            sideList.array.forEach(element => {
                <a onClick={() => props.page.setCurrentPage(listCount)}>{element}</a>
                listCount++;
            })   
        )
    }

    return (
        <div className="left">
            <listElement/>
        </div>
    )
}

export {SidebarComponent};
